INSERT INTO `field` VALUES (7,8,'CDN','Création et Design Numérique','La filière \"Création et Design Numérique\" est une discipline qui allie créativité et technologie pour concevoir des produits visuels et interactifs. Elle englobe divers aspects tels que le graphisme, l\'animation, le design d\'interfaces utilisateur (UI) et d\'expérience utilisateur (UX), ainsi que la création de contenus numériques pour les médias sociaux, les sites web, et les applications. Cette filière prépare les étudiants à maîtriser les outils et techniques modernes du design numérique, tout en développant leur sens artistique et leur capacité à innover dans un monde de plus en plus digitalisé.'),(8,8,'INS','Ingenierie Nnumerique Sociotechnique','La filière \"Ingénierie Numérique Sociotechnique\" explore l\'intersection entre la technologie numérique et les sciences sociales. Elle vise à concevoir, développer et gérer des systèmes technologiques qui prennent en compte les interactions humaines et les implications sociales. Les étudiants acquièrent des compétences en ingénierie informatique, en analyse de données, et en gestion de projets tout en intégrant des perspectives sociologiques et éthiques. Cette approche holistique permet de créer des solutions technologiques innovantes et responsables, adaptées aux besoins et aux défis des sociétés modernes.'),(9,8,'ISN','Ingenierie des Systemes Numeriques','La filière \"Ingénierie des Systèmes Numériques\" se concentre sur la conception, le développement et la gestion de systèmes numériques complexes. Les étudiants y acquièrent des compétences en informatique, électronique, et communication pour créer des solutions intégrées et performantes. Ils apprennent à concevoir des architectures de systèmes, à développer des logiciels embarqués, et à optimiser les performances des réseaux et des systèmes. Cette formation prépare les futurs ingénieurs à répondre aux défis technologiques contemporains en proposant des systèmes numériques fiables, sécurisés et innovants.');
/*!40000 ALTER TABLE `field` ENABLE KEYS */;
UNLOCK TABLES;

